import React from 'react';
import './App.css';
import { Route,Routes } from 'react-router-dom';

/**
 * ?  =====Import Components=====
 */
import Home from './Pages/Home';

function App() {
  return (
    <div>
      <Routes>
        <Route path='/'>
        <Home />
        </Route>
      </Routes>

    </div>
  );
}

export default App;
